declare module '@craftjs/core' {
  import { ComponentProps } from 'react';
  import { ElementType } from 'react';
  import { FC } from 'react';
  import { createContext } from 'react';
  import { forwardRef } from 'react';
  import { useCallback } from 'react';
  import { useMemo } from 'react';
  import { useRef } from 'react';
  import { useState } from 'react';

  export const useEditor: () => any;
  export const useNode: (id: string) => any;

  export type ComponentProps = any;
  export type ElementType = any;
  export type FC = any;
  export type createContext = any;
  export type forwardRef = any;
  export type useCallback = any;
  export type useMemo = any;
  export type useRef = any;
  export type useState = any;
}

declare module '@craftjs/utils' {
  import { Delete } from 'react';
  import { useEffectOnce } from 'react';

  export const Delete: React.FC<any>;
  export const useEffectOnce: (callback: () => void, dependencies?: any[]) => void;

  export type Delete = any;
  export type useEffectOnce = any;
}

declare module 'react' {
  import { ComponentProps } from 'react';
  import { ElementType } from 'react';
  import { FC } from 'react';
  import { createContext } from 'react';
  import { forwardRef } from 'react';
  import { useCallback } from 'react';
  import { useMemo } from 'react';
  import { useRef } from 'react';
  import { useState } from 'react';

  export const ComponentProps: any;
  export const ElementType: any;
  export const FC: any;
  export const createContext: any;
  export const forwardRef: any;
  export const useCallback: any;
  export const useMemo: any;
  export const useRef: any;
  export const useState: any;

  export default React;
}

declare module 'slate' {
  // No specific types needed for Slate
}

declare module 'slate-react' {
  import { Editable } from 'slate';

  export const Editable: React.FC<any>;

  export type Editable = any;
}
